package interviewbit;

import org.junit.Test;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

import static org.junit.Assert.assertEquals;

/**
 * https://www.interviewbit.com/problems/window-string/
 */
public class MinimumSubstringWindow {

    @Test
    public void test() {
        assertEquals("BANC", minWindow("ADOBECODEBANC", "ABC"));
        assertEquals("AA", minWindow("AAAAAA", "AA"));
//
//        String s = "";
//        String t = "";
//        assertEquals("AA", minWindow(s, t));
    }

    public String minWindow(String S, String T) {

        Map<Character, List<Integer>> pos = new HashMap<>();
        for (int i=0; i<T.length(); i++) {
            char current = T.charAt(i);
            if (!pos.containsKey(current)) {
                pos.put(current, new ArrayList<>());
            }
            pos.get(current).add(-1);
        }

        int min = Integer.MAX_VALUE;
        String result = "";
        for (int i=0; i<S.length(); i++) {
            char current = S.charAt(i);
            if (pos.keySet().contains(current)) {
                pos.get(current).remove(0);
                pos.get(current).add(i);
            }
            String sub = getSubstring(pos, S);
            if (!sub.equals("") && min > sub.length()) {
                min = sub.length();
                result = sub;
            }
        }

        return result;
    }

    public String getSubstring(Map<Character, List<Integer>> pos, String s) {

        int min = Integer.MAX_VALUE;
        int max = Integer.MIN_VALUE;

        for (Character c: pos.keySet()) {
            int minForChar = pos.get(c).stream().min(Integer::compare).get();
            if (minForChar == -1) {
                return "";
            }
            int maxForChar = pos.get(c).stream().max(Integer::compare).get();
            min = Math.min(min, minForChar);
            max = Math.max(max, maxForChar);
        }

        if (min == -1 || max == -1) {
            return "";
        }
        return s.substring(min, max+1);
    }

}
